import React from 'react';
import TopBar from './components/TopBar';
import CardsContainer from './components/CardsContainer';
import Cart from './components/Cart';
function App() {
  return (
  <>
    <TopBar/>
    <div className='content'>
    <CardsContainer/>
    <Cart/>
    </div>
    </>
  );
}

export default App;
